Iwia is like a work of art, a living statue of perfection. Still, there is nothing artificial on this girl. She is a natural beauty and it would be a shame to hide such a lovely sight from the people. So we asked her to remove her attire and let us admire the tender beauty of the female body... and she agreed! Thanks, Iwia!
